function Result() {
    const fileInput = React.useRef();

    const handleButtonClick = e => {
        fileInput.current.click();
    };

    return(
        <>
            <div className="result-row">
                <div className='left-top-image'>
                <label for = "upload-file" style={{
                    padding: "6px 25px",
                    backgroundColor:"#FF6600",
                    borderRadius: "4px",
                    color: "white",
                    cursor: "pointer"
                }}> 다른 이미지 파일
                    <input type="file" id="upload-file" multiple="multiple" 
                        style={{ display : "none" }}/>
                </label>

                <img src = {process.env.PUBLIC_URL + "/image_src/sample.png"}
                    style = {{
                        marginTop : "10%",
                        width : "75%",
                        height : "80%",
                        borderRadius : "40px",
                    }}/>
                </div>

                <div className="left-bottom-text">
                    <br/><br/><br/><br/><br/>첨부 이미지 모델 스펙 출력 영역
                </div>

                <div className="right-image" style={{

                }}>
                    <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
                    결과 이미지 출력 영역
                </div>
            </div>


        </>

    );
}

export default Result;
